import React from 'react'
import Input from '@material-ui/core/Input';
import TextField from '@material-ui/core/TextField';

class Signup extends React.Component {
    constructor() {
        super()
        this.state = {
            username: '',
            email: '',
            password: '',
            confirmPassword: '',

        }
    }

    render() {
        return (
            <div>
                <TextField
                    id="outlined-search"
                    label="Username"
                    type = 'text'
                    margin="normal"
                    InputProps={{
                        readOnly: true,
                    }}
                    variant="outlined"
                />

            </div>
        )
    }
}

export default Signup;
